import React, { Component } from "react";

class Track extends Component {
	
	
	render () {
		return (
			<p style={{position: "relative", border: "solid 1px black", width: "10%", left: "5%", top: "50px" }} onMouseOver="expand(this)">Song</p>
		);
	}
}

export default Track;
